import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";


import './App.css';
import Header from './components/Header';
import NotesListPage from "./pages/NotesListPage";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" exact component={NotesListPage} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
